import React, { useState, useEffect } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';

function CreateContact() {
    const [data, setData] = useState(null);
    const apiUrl = 'http://localhost:8080/add-user'; // Replace with your API endpoint URL

    useEffect(() => {
        fetch(apiUrl)
            .then((response) => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then((jsonData) => {
                setData(jsonData);
            })
            .catch((error) => {
                console.error('Error fetching data:', error);
            });
    }, []);

    return (
        <div>
            <button className="create-contact-button">
                <FontAwesomeIcon icon={faPlus} /> Create New Contact
            </button>
            {data ? (
                <div>
                    <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Mobile No</th>
                        <th>Email</th>
                        <th>Address</th>
                        <th>Edit</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map((item) => (
                        <tr key={item.Id}>
                            <td>{item.Name}</td>
                            <td>{item.Mobileno}</td>
                            <td>{item.Email}</td>
                            <td>{item.Address}</td>
                            <td>
                                <button className="edit-button">&#8942;</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
                </div>
            ) : null
            }
        </div>
    );
}

export default CreateContact;
